import React from 'react';
import {Route, Routes} from 'react-router-dom';

import MainPage from "./MainPage";
import Navbar from "./Navbar/Navbar";
import Footer from "./Footer/Footer";

import Immovables from "./Categories/Immovables/Immovables";
import Transport from "./Categories/Transport/Transport";
import Household from "./Categories/Household/Household";

import CreateAd from "./CreateAd/CreateAd";

const Router = (props) => {

  return (
      <div>
        <Navbar/>
        <Routes>
          <Route path={"/"} element={<MainPage/>}/>

          <Route path={"/nedvijimost"} element={<Immovables listAd={props.immovables.listAd}/>}/>
          <Route path={"/transport"} element={<Transport listAd={props.transport.listAd}/>}/>
          <Route path={"/all_for_home"} element={<Household listAd={props.household.listAd}/>}/>

          <Route exact path={"/ad/create"} element={<CreateAd/>}/>

        </Routes>
        <Footer/>
      </div>
  );
};

export default Router;
